import React from 'react';
import './App.css';

function NearbyDermatologists() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>Nearby Dermatologists</h2>
        <p>Find dermatologists near your location using the map below:</p>
        <iframe
          title="Nearby Dermatologists"
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3153.835434509374!2d-122.41941548468132!3d37.77492927975962!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x80858064d2e0f3b1%3A0x4c3c8b4d8b8b8b8b!2sDermatologist!5e0!3m2!1sen!2sus!4v1697040000000!5m2!1sen!2sus"
          width="100%"
          height="500"
          style={{ border: 0 }}
          allowFullScreen=""
          loading="lazy"
        ></iframe>
      </header>
    </div>
  );
}

export default NearbyDermatologists;
